import React, { useEffect, useState } from 'react';
import './Home.css';
import video from 'h2.mp4'; // Adjust the path based on where the video is located

function Home() {
  const [showText, setShowText] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => {
      setShowText(true);
    }, 2000); // Delay of 2 seconds
    return () => clearTimeout(timer);
  }, []);

  return (
    <div className="home">
      <video autoPlay loop muted className="background-video">
       <source src="C:/Users/shreya/Downloads/h2.mp4" type="video/mp4" />
       Your browser does not support the video tag.
      </video>

      {showText && (
        <div className="content">
          <h1 className="glow">Welcome to Health&me</h1>
          <p className="glow-text">Your personal guide to food logging, exercise tracking, and more!</p>
        </div>
      )}
    </div>
  );
}

export default Home;
